import React from 'react';

function Image({ image, name }) {
  return (
    <img
      src={image}
      alt={name}
      style={{
        width: '300px',
        height: '300px',
        objectFit: 'cover',
        borderRadius: '20px',
        boxShadow: '0 4px 10px rgba(0,0,0,0.1)',
        margin: 'auto',
      }}
    />
  );
}

export default Image;
